import React from 'react';



 const Search = (props) => {
  return (
    <form onSubmit={this.handleSubmit}>
    <div>
      <Input type="text" onChange={this.handleChange} ref="word"/>
      <button type="submit">Search</button>
    </div>
    </form>
  );
}

export default Search;
